import React from 'react'
import * as MapGL from 'react-map-gl'
import './places.json'




export default class Globe extends React.Component {
    state = {
        viewport: {
            width: 400,
            height: 400,
            latitude: 37.7577,
            longitude: -122.4376,
            zoom: 8
        }
    }

    render(){
        return(
            <MapGL
                {...this.state.viewport}
            onViewportChange = {(viewport) => this.setState({viewport})}
            />
        )
    }


}
